import './App.css';
import { BrowserRouter } from 'react-router-dom';
import Home from './components/Home';
import Question from './components/Questions';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
        <main>
          <div className="questioncontainer">
          <BrowserRouter >
            <Home />
            <Question />
          </BrowserRouter>
          </div>
        </main>
    </div>
  );
}

export default App;
